Use a POST request to the service endpoint https://app.domain/lnurlpay/[pubkey] with the following payload to register the app for an LNURL-Pay service: { "time": 1231006505, // Current UNIX timestamp "webhook_url": "[notification service webhook URL]", "username": "[optional username]", "signature": "[signed message]"
} The signature refers to the result of a message signed by the private key of the pubkey, where the message is comprised of the following text: [time]-[webhook_url] or, when the optional username field is set: [time]-[webhook_url]-[username] where time, webhook_url and username are the payload fields. The service responds with following payload: { "lnurl": "[LNURL-pay encoded endpoint]", "lightning_address": "username@app.domain" // Only set when username is included
} Developer note When a user changes their already registered username, this previous username is freely available to be registered by another user.

