The Notification Plugin handles several use cases by default to automatically process push notifications sent via the NDS when an SDK service calls the registered webhook. If your use case isn't covered by the Notification Plugin, you can extend the plugin to handle custom notifications . Updating a swap When making a payment via lightning or a Bitcoin onchain address, the SDK uses a swap service to convert between the Liquid sidechain and Bitcoin onchain or Lightning. A swap service is used to monitor changes to the swap status and send push notifications to wake the device to progress the swap. When the Notification Plugin receives this notification from the NDS, it will start the SDK and let the SDK complete the swap or progress it to the next state. The swap_updated notification type will be received by the webhook in the following format: { "event": "swap.update", "data": { "id": "", // The hashed id of the swap "status": "" // The latest swap status }
} Swap type Possible received statuses Submarine transaction.claim.pending, invoice.failedToPay, swap.expired, transaction.lockupFailed Reverse transaction.mempool / transaction.confirmed * Chain transaction.server.confirmed, transaction.lockupFailed, transaction.failed * Depending if a zero-conf swap is accepted Handling LNURL pay requests Having the ability to process push notifications when the application is in the background or closed also opens up the ability to handle payment requests from a static LNURL or Lightning address. To do this, the application also needs to register a webhook with an LNURL-pay service , then when the LNURL service receives a request on the static LNURL address, it will forward it via the NDS to the application. The Notification Plugin handles the two-step flow for fulfilling these requests. Firstly the LNURL service receives a request for LNURL-pay information to get the min/max amount that can be received. The LNURL service calls the registered webhook, and upon receiving this notification, the Notification Plugin will connect to the Breez SDK and send a response back to the LNURL service based on the swap service limits. The lnurlpay_info notification type will be received by the webhook in the following format: { "template": "lnurlpay_info", "data": { "callback_url": "", // The URL of the LNURL service "reply_url": "" // The URL to reply to this request }
} Secondly the LNURL service receives a request for an invoice based on the selected payment amount. The LNURL service calls the registered webhook, and upon receiving this notification, the Notification Plugin will start the SDK and call receive payment for the requested amount. The resulting invoice is then returned to the LNURL service. The lnurlpay_invoice notification type will be received by the webhook in the following format: { "template": "lnurlpay_invoice", "data": { "amount": 0, // The amount in millisatoshis within the min/max sendable range "reply_url": "" // The URL to reply to this request }
}

